import prettyReact from './images/pretty-react-logo.png.svg'

export default function NavBar() {
  function magic() {
    document.getElementById('image').style.width = "30px"
  }
  return (
   <div className='new'>
        <img src={ prettyReact } alt='React logo' id='image'/>
        <button className='button'>Click me</button>
   </div>
  );
};
